INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "2015/12/17 15:00:00", 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, 2, "2030/12/17 14:59:59", 1, -363.0, 2104010, "シェフィ", 106401, 0.0, 0.0, 1);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "2015/12/17 15:00:00", 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004, 1, "2030/12/17 14:59:59", 1, -363.0, 0, "ペコリーヌ", 105801, 0.0, 0.0, 1);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "2015/12/17 15:00:00", 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001, 1, "2030/12/17 14:59:59", 1, -363.0, 0, "コッコロ", 105901, 0.0, 0.0, 1);
