INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "2015/12/17 15:00:00", 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003, 1, "2030/12/17 14:59:59", 1, -363.0, 0, "ペコリーヌ", 105801, 0.0, 0.0, 1);
