INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "2019/01/31 12:00:00", 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, 1, "2030/12/17 14:59:59", 2, -385.0, 0, "エリコ（バレンタイン）", 109001, 10.11, 8.0, 3);
