INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "2019/01/31 12:00:00", 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, 1, "2030/12/17 14:59:59", 1, 0.0, 0, "エリコ（バレンタイン）", 109002, 0.0, 0.0, 6);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "2019/01/31 12:00:00", 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, 1, "2030/12/17 14:59:59", 1, 0.0, 0, "エリコ（バレンタイン）", 109002, 0.0, 0.0, 7);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "2019/01/31 12:00:00", 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, 1, "2030/12/17 14:59:59", 1, 0.0, 0, "エリコ（バレンタイン）", 109002, 0.0, 0.0, 8);
